Yes, your approach to creating a layout component with variants using Tailwind CSS is correct. You are using the `classNames` library to conditionally apply classes based on the `variant` prop, which is a common and effective way to handle this in React.

Here's a slight refinement of your code to ensure it's clear and concise:

```jsx
import React from 'react';
import classNames from 'classnames';

const Layout = ({ children, variant = 'full-width' }) => {
  const layoutClass = classNames({
    'max-w-full': variant === 'full-width',
    'max-w-screen-xl mx-auto': variant === 'centered',
  });

  return (
    <div className={layoutClass}>
      {children}
    </div>
  );
};

export default Layout;
```

### Explanation:

1. **Props**:
   - `children`: This prop will contain the content that will be wrapped by the `Layout` component.
   - `variant`: This prop determines the layout style. It defaults to `'full-width'`.

2. **classNames**:
   - The `classNames` function is used to conditionally apply Tailwind CSS classes based on the `variant` prop.
   - `'max-w-full'`: Applies a max-width of 100% when the variant is `'full-width'`.
   - `'max-w-screen-xl mx-auto'`: Applies a max-width of 1200px and centers the content horizontally when the variant is `'centered'`.

